//react libraries
import React, { Component } from "react";
import ReactDOM from 'react-dom';
import '../../index.css';

//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';

//components
import AddPlayer from "../game/add-player.jsx";
import DarePlayers from "../game/dare-players.jsx";
import ClearDares from "../game/clear-dares.jsx";
import DeletePlayers from "../game/delete-players.jsx";
import Settings from "../game/settings.jsx";

class Banner extends Component {
  render(){
    return(
      <div class="container-fluid">
        <div class="row" align="left">
          <div class="col">
            <h1>darelist</h1>
          </div>
        </div>
        <div class="row">
          <div class="col">
            <hr />
          </div>
        </div>
        <div class="row">
          <div class="col-1 offset-2">
            <AddPlayer />
          </div>
          <div class="col-1">
            <DarePlayers />
          </div>
          <div class="col-1">
            <ClearDares />
          </div>
          <div class="col-1">
            <DeletePlayers />
          </div>
          <div class="col-1">
            <Settings />
          </div>
        </div>
      </div>
    );
  }
}

export default Banner;
